@GAFUFOAMARGADO @InformantesTV No es deliberadamente: 

Las conductas suicidas no aparecen de un día para otro. El comportamiento suicida está determinado por un gran número de causas complejas. Usualmente vienen desde la infancia. 

El intento de suicidio también puede darse buscando una ganancia secundaria.

@Amy03898327 @Bycho29 @GiulianaParga @Francis25830521 Con esa moral y autoestima suicida pronto porfavor. No mereces ser mujer. La mujer es valiente, se defiende y lucha.... y tu respondes tamaña estupidez. 
No has entendido absolutamente nada de nada. 
Cerebro de corcho. Al menos flotas en alta mar.
